        html: '<p>This means that you either do not have an hd model for controlnet
          or there is another version of it.<br>How to solve:</p>

          <ol>

          <li>Download and install the model - <a href="https://huggingface.co/webui/ControlNet-modules-safetensors/tree/main">https://huggingface.co/webui/ControlNet-modules-safetensors/tree/main</a><br>stable-diffusion-webui\extensions\sd-webui-controlnet\models
          - path to models</li>

          </ol>

          <p>OR</p>

          <ol start="2">

          <li>Edit temporalnet.py<br>This is the 51th line, located under the promts
          and where you adjust the generation parameters<br>You can see which model
          you have in the models folder or when choosing a controlnet model inside
          the AUTOMATIC1111 web ui<br>You need to replace the line ("model": "control_hed-fp16
          [13fee50b]",) with ("model": "control_sd15_hed [fef5e48e]",) - without brackets</li>

          </ol>

          '
